Because eases are used so often, there is some shorthand to make writing many eases more simple. Chain Calls Multiple eases can be specified after writing the word ease once. This is called a chain call, because it calls the ease function with each of the eases, and only works if the eases are in a chain, ie. no other code appears in between the eases. ease
{5, 1, outCirc, 360, 'rotationz'}
{6, 1, outCirc, 0, 'rotationz'} Multiple Mods If multiple mods need to be changed at the same time, multiple target/modifier pairs can be specified in an ease. Here is an example that affects many mods with only one ease: ease {5, 3, linear, 30, 'bumpy', 10, 'dizzy', 5000, 'beat', 500, 'digital', 100, 'tipsy', 100, 'drunk',
} This form is only useful when multiple mods need to be changed in exactly the same way. Each target/modifier pair is eased separately. Shorthand for plr The plr argument to eases acts differently from other arguments because if unspecified, it will check for a plr global variable. This is useful if many eases in sequence need to use special player numbers. Here is an example of some eases that all affect player 1 only: plr = 1
ease {0, 1, linear, 100, 'reverse'}
ease {1, 1, linear, 0, 'reverse'}
ease {2, 1, linear, 100, 'reverse'}
ease {3, 1, linear, 0, 'reverse'}
ease {4, 1, linear, 100, 'reverse'}
-- reset the player to normal so later eases won't be affected
plr = nil This only works if the global plr is set. It is recommended that pn is used for local variables that refer to the player number so that the global plr can remain in scope. The optional argument will take precedence over the global if both are set. By default, if the plr global isn't present, the function acts on {1, 2}, which means that ease transitions without a specified plr will affect both the players. This way to pass the plr argument is especially convenient for writing and using helper functions. Here is an example helper function: local function wiggle_around(beat) ease {beat, 1, pop, 100, 'drunk'} {beat, 1, tap, 100, 'tipsy'}
end By default, this function affects both players, because the player number isn't specified in either of its eases. However, the caller can specify a player number using the plr global trick: -- control which player is affected:
plr = 1
wiggle_around(10) plr = 2
wiggle_around(20) -- reset so that future eases aren't affected
plr = nil This plr shorthand means that helper functions can be applied to specific players without the need for an explicit player argument to be passed around. Shorthand for mode Instead of writing mode = 'end', adding m=e does the same thing, but is shorter to type. Unlike plr, there is no global variable check for mode.
